        self.actionAuto_Compute_Clipping_Planes.setToolTip(QtGui.QApplication.translate("MainWindow", "<html><head/><body><p><span style=\" font-weight:600; text-decoration: underline;\">Auto Clipping</span></p><p><span style=\" font-weight:400;\">Expansive scenes may show &quot;Z-fighting&quot;, where nearby surfaces pop or shimmer.  </span><span style=\" font-weight:600;\">Auto Compute Clipping Planes</span><span style=\" font-weight:400;\"> adjusts the camera\'s clipping planes to fix this.  When enabled, the </span><span style=\" font-weight:600;\">Frame Selected</span><span style=\" font-weight:400;\"> command readjusts clip planes too.</span></p><p><span style=\" font-weight:400;\">Leaving and then re-entering this mode will reset the view used to optimize the clipping planes.</span></p><p><span style=\" font-weight:400;\">Auto clipping is not useful in all situations, such as animated scenes in which the &quot;extent&quot; of the scene changes over time, and for close-up work.</span></p></body></html>", None, QtGui.QApplication.UnicodeUTF8))
